import './App.css';
import {Component} from 'react'

class App extends Component{
  constructor(props){
    super(props);
    this.state = {apiResponse:""};
  }

  callAPI(){
    fetch("http://localhost:9000/testAPI")
        .then(res => res.text())
        .then(res => this.setState({apiResponse:res}))
        .catch(err => err);
  }

  componentDidMount(){
    this.callAPI();
  }

  render(){
    return (
      <div className="App">
        <h1>react router test</h1>
        <hr></hr>
        <a href="./components/About">About</a>
        <a href="./components/Home" style={{marginLeft:'20px'}}>Home</a>
        <hr></hr>
        <Home/>
        <About/>
        <p className="App-test">{this.state.apiResponse}</p>
      </div>
    );
  }
}



export default App;
